//   render() {
//     return (
//       <div class="footer">
//         <p class="copyright">Harpreet Randhawa</p>
//         <p class="copyright">Created using HTML & CSS</p>
//       </div>
//     );
//   }
// }

class Nav extends Component {
  render() {
    return (
      <ReactBootStrap.Navbar
        collapseOnSelect
        expand="xl"
        bg="dark" // dark, primary, danger
        variant="dark"
        fixed="top"
        className="navtext"
      >
        <ReactBootStrap.Navbar.Brand href="#home">
          Harpreet Randhawa
          <img src={logo} className="App-logo" alt="logo" />
        </ReactBootStrap.Navbar.Brand>
        <ReactBootStrap.Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <ReactBootStrap.Navbar.Collapse id="responsive-navbar-nav">
          <ReactBootStrap.Nav className="mr-auto" text-allign="center">
            <ReactBootStrap.Nav.Link href="#home" className="navtext">
              Home
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#resume" className="navtext">
              Resume
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#aboutme" className="navtext">
              AboutMe
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#comments" className="navtext">
              Comments
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#contact" className="navtext">
              Contact
            </ReactBootStrap.Nav.Link>
          </ReactBootStrap.Nav>
          <ReactBootStrap.Nav></ReactBootStrap.Nav>
        </ReactBootStrap.Navbar.Collapse>
      </ReactBootStrap.Navbar>
    );
  }
}

class Header extends Component {
  render() {
    return (
      <header className="App-header">
        <div className="container5">
          <div id="box">
            <img src="https://i.imgur.com/JpeUHd0.jpg" alt="Me" id="cover" />
          </div>
        </div>
        <br></br>
        <h1 className="App-title"> Harpreet Randhawa</h1>
        <h3> Programmer</h3>
      </header>
    );
  }
}

const AboutMe = () => {
  return (
    <div className="App-header-aboutme">
      <CardGroup>
        <Card>
          <Card.Img
            variant="top"
            src="blob:https://imgur.com/f7674d59-59b3-4ebe-8d30-2fd6542c15d8"
          />
          <Card.Body>
            <Card.Title>Card title</Card.Title>
            <Card.Text>
              This is a wider card with supporting text below as a natural
              lead-in to additional content. This content is a little bit
              longer.
            </Card.Text>
          </Card.Body>
          <Card.Footer>
            <small className="text-muted">
              {" "}
              This is a wider card with supporting text below as a natural
              lead-in to additional content. This card has even longer content
              than the first to show that equal height action.
            </small>
          </Card.Footer>
        </Card>
        <Card>
          <Card.Img variant="top" src="holder.js/100px160" />
          <Card.Body>
            <Card.Title>Card title</Card.Title>
            <Card.Text>
              This card has supporting text below as a natural lead-in to
              additional content.{" "}
            </Card.Text>
          </Card.Body>
          <Card.Footer>
            <small className="text-muted">
              {" "}
              This is a wider card with supporting text below as a natural
              lead-in to additional content. This card has even longer content
              than the first to show that equal height action.
            </small>
          </Card.Footer>
        </Card>
        <Card>
          <Card.Img variant="top" src="holder.js/100px160" />
          <Card.Body>
            <Card.Title>Card title</Card.Title>
            <Card.Text>
              This is a wider card with supporting text below as a natural
              lead-in to additional content. This card has even longer content
              than the first to show that equal height action.
            </Card.Text>
          </Card.Body>
          <Card.Footer>
            <small className="text-muted">
              {" "}
              This is a wider card with supporting text below as a natural
              lead-in to additional content. This card has even longer content
              than the first to show that equal height action 3.
            </small>
          </Card.Footer>
        </Card>
      </CardGroup>
    </div>
  );
};

const Resume = () => {
  return (
    <div className="App-header-resume">
      {/* <img src="https://i.imgur.com/rtPObQD.jpg" alt="resume" /> */}
      <img
        src="https://i.imgur.com/FRkdFhb.jpg"
        alt="resume"
        className="resume"
      />
    </div>
  );
};

const Contact = () => {
  return (
    <div className="App-header-contact">
      <p>Contact information</p>
      <p>Email: Harpreetsrandhawa99@gmail.com</p>
      <p>LinkedIn: https://www.linkedin.com/in/harpreet-randhawa-965695159/</p>
      <p>Phone Number: 848-228-6014</p>
    </div>
  );
};

const Comments = () => {
  return (
    <div className="App-header-comments">
      <Carousel>
        <Carousel.Item>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Item>
        <Carousel.Item>
          <h3>Second slide label</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Item>
        <Carousel.Item>
          <h3>Third slide label</h3>
          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Item>
      </Carousel>
    </div>
  );
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <Nav />
        <Header />
        <AboutMe />
        <Resume />
        <Comments />
        <Contact />
      </div>
    );
  }
}

export default App;
